    "/api/order/{orderId}/add-food-order": {
      "post": {
        "tags": [
          "Order"
        ],
        "summary": "Add food order",
        "parameters": [
          {
            "name": "orderId",
            "in": "path",
            "description": "Order ID",
            "required": true,
            "schema": {
              "type": "integer",
              "description": "Order ID",
              "format": "int32"
            }
          }
        ],
        "requestBody": {
          "description": "Food orders",
          "content": {
            "application/json-patch+json": {
              "schema": {
                "type": "array",
                "items": {
                  "$ref": "#/components/schemas/FoodOrderVm"
                },
                "description": "Food orders",
                "nullable": true
              }
            },
            "application/json": {
